           cvo:variation_type "single nucleotide variant" ;
           cvo:record_status "current" .
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "PREFIX chebi: <http://purl.obolibrary.org/obo/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?compound ?label ?chebi_id
WHERE {
  ?compound rdfs:label ?label .
  ?compound rdfs:label "ATP"@en .
  BIND(REPLACE(STR(?compound), "http://purl.obolibrary.org/obo/CHEBI_", "") AS ?chebi_id)
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "PREFIX chebi: <http://purl.obolibrary.org/obo/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX oboInOwl: <http://www.geneontology.org/formats/oboInOwl#>

SELECT ?compound ?label ?synonym ?chebi_id
WHERE {
  ?compound rdfs:label ?label .
  OPTIONAL { ?compound oboInOwl:hasExactSynonym ?synonym }
  FILTER(CONTAINS(LCASE(?label), "atp") || CONTAINS(LCASE(?synonym), "atp"))
  BIND(REPLACE(STR(?compound), "http://purl.obolibrary.org/obo/CHEBI_", "") AS ?chebi_id)
}
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "PREFIX chebi: <http://purl.obolibrary.org/obo/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?compound ?label
WHERE {
  ?compound a chebi:CHEBI_24431 .
  ?compound rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "adenosine") && CONTAINS(LCASE(?label), "triphosphate"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?compound ?label
WHERE {
  ?compound rdfs:label ?label .
  FILTER(REGEX(?label, "adenosine.*triphosphate", "i") || ?label = "ATP"@en)
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rh: <http://rdf.rhea-db.org/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX chebi: <http://purl.obolibrary.org/obo/>

SELECT DISTINCT ?chebi_compound ?label
WHERE {
  ?reaction rh:side/rh:contains/rh:compound ?chebi_compound .
  ?chebi_compound rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "atp") || CONTAINS(LCASE(?label), "adenosine triphosphate"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "rhea"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT DISTINCT ?compound ?label
WHERE {
  ?reaction rhea:side ?side .
  ?side rhea:contains ?participant .
  ?participant rhea:compound ?compound .
  ?compound rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "atp") || CONTAINS(LCASE(?label), "adenosine triphosphate"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>

SELECT ?reaction ?equation
WHERE {
  ?reaction a rdfs:Class ;
           rhea:equation ?equation .
  FILTER(CONTAINS(LCASE(?equation), "atp"))
}
LIMIT 5"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "SELECT ?s ?p ?o 
WHERE { 
  ?s ?p ?o .
  FILTER(CONTAINS(STR(?s), "CHEBI_15422"))
} 
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "PREFIX chebi: <http://purl.obolibrary.org/obo/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?compound ?label
WHERE {
  VALUES ?compound { 
    chebi:CHEBI_15422 
    chebi:CHEBI_30616 
  }
  ?compound rdfs:label ?label .
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rhea: <http://rdf.rhea-db.org/>
PREFIX chebi: <http://purl.obolibrary.org/obo/>

SELECT ?reaction ?equation
WHERE {
  ?reaction rhea:side ?side .
  ?side rhea:contains ?participant .
  ?participant rhea:compound ?compound .
  ?reaction rhea:equation ?equation .
  FILTER(?compound = chebi:CHEBI_15422 || ?compound = chebi:CHEBI_30616)
}
LIMIT 5"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX chebi: <http://purl.obolibrary.org/obo/>

ASK {
  chebi:CHEBI_15422 ?p ?o .
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "rhea", "sparql_query": "PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX chebi: <http://purl.obolibrary.org/obo/>

SELECT ?chebi_id ?label
WHERE {
  VALUES ?chebi_compound { 
    chebi:CHEBI_15422 
    chebi:CHEBI_30616 
  }
  ?chebi_compound rdfs:label ?label .
  BIND(REPLACE(STR(?chebi_compound), "http://purl.obolibrary.org/obo/CHEBI_", "") AS ?chebi_id)
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX clinvar: <http://purl.jp/bio/10/clinvar/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dct: <http://purl.org/dc/terms/>

SELECT ?variant ?name ?lastUpdated ?gene
WHERE {
  ?variant a clinvar:VariationArchive ;
           rdfs:label ?name ;
           dct:modified ?lastUpdated ;
           clinvar:interpreted_for_gene ?gene .
  ?gene rdfs:label "BRCA1" .
  FILTER(CONTAINS(LCASE(?name), "c.5266dup"))
}
ORDER BY DESC(?lastUpdated)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX clinvar: <http://purl.jp/bio/10/clinvar/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dct: <http://purl.org/dc/terms/>

SELECT ?variant ?name ?lastUpdated
WHERE {
  ?variant a clinvar:VariationArchive ;
           rdfs:label ?name ;
           dct:modified ?lastUpdated .
  FILTER(CONTAINS(?name, "BRCA1") && CONTAINS(?name, "c.5266dup"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?variant ?label ?date_last_updated ?accession
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:date_last_updated ?date_last_updated ;
           cvo:accession ?accession .
  ?label bif:contains "'c.5266dup'" .
  ?label bif:contains "'BRCA1'" .
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?variant ?label ?date_last_updated ?accession
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:date_last_updated ?date_last_updated ;
           cvo:accession ?accession .
  FILTER(CONTAINS(LCASE(?label), "c.5266dup"))
  FILTER(CONTAINS(LCASE(?label), "brca1"))
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?variant ?label ?date_last_updated
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:date_last_updated ?date_last_updated .
  ?label bif:contains "'BRCA1'" .
}
LIMIT 5"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?variant ?label ?date_last_updated ?accession ?variation_id
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:date_last_updated ?date_last_updated ;
           cvo:accession ?accession ;
