  ?label bif:contains "'c.5266dup'" .
}
LIMIT 10"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT ?molecule ?label ?chemblId ?target ?targetLabel ?value ?pChembl
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel .
  ?molecule rdfs:label ?label ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  OPTIONAL { ?activity cco:pChembl ?pChembl }
  FILTER(xsd:decimal(?value) < 100)
}
ORDER BY DESC(?sc) xsd:decimal(?value)
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?label ?chemblId ?target ?targetLabel ?value ?pChembl ?units
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits ?units ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay/cco:hasTarget ?target .
  ?target rdfs:label ?targetLabel .
  ?molecule rdfs:label ?label ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  OPTIONAL { ?activity cco:pChembl ?pChembl }
  FILTER(?units = "nM" && xsd:decimal(?value) < 100 && xsd:decimal(?value) > 0)
}
ORDER BY DESC(?sc) xsd:decimal(?value)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?label ?chemblId ?target ?targetLabel ?value ?pChembl ?assayType
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay ?assay .
  ?assay cco:hasTarget ?target ;
         cco:assayType ?assayType .
  ?target rdfs:label ?targetLabel .
  ?molecule rdfs:label ?label ;
            cco:chemblId ?chemblId .
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  OPTIONAL { ?activity cco:pChembl ?pChembl }
  FILTER(xsd:decimal(?value) <= 100 && xsd:decimal(?value) >= 0.1)
}
ORDER BY DESC(?sc) xsd:decimal(?value)
LIMIT 100"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?molecule ?label ?chemblId ?target ?targetLabel ?value ?pChembl ?assayType ?moleculeType
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?activity a cco:Activity ;
            cco:standardType "IC50" ;
            cco:standardValue ?value ;
            cco:standardUnits "nM" ;
            cco:hasMolecule ?molecule ;
            cco:hasAssay ?assay .
  ?assay cco:hasTarget ?target ;
         cco:assayType ?assayType .
  ?target rdfs:label ?targetLabel .
  ?molecule rdfs:label ?label ;
            cco:chemblId ?chemblId .
  OPTIONAL { ?molecule cco:substanceType ?moleculeType }
  ?targetLabel bif:contains "'kinase'" option (score ?sc)
  OPTIONAL { ?activity cco:pChembl ?pChembl }
  FILTER(xsd:decimal(?value) <= 100 && xsd:decimal(?value) >= 1)
  FILTER(?label IN ("IBRUTINIB", "IMATINIB", "STAUROSPORINE", "GEFITINIB", "ERLOTINIB", "SUNITINIB", "SORAFENIB", "LAPATINIB"))
}
ORDER BY DESC(?sc) ?label xsd:decimal(?value)
LIMIT 50"}}]
